import React, { useState } from 'react';
import { Form, Button, Card, Alert, Row, Col } from 'react-bootstrap';
import { resumeAPI } from '../services/api';

const ResumeUpload = ({ onResumeUploaded }) => {
  const [formData, setFormData] = useState({
    candidateName: '', email: '', phone: '', skills: '', experience: '', education: ''
  });
  const [file, setFile] = useState(null);
  const [message, setMessage] = useState('');
  const [loading, setLoading] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!file) {
      setMessage('Please select a resume file üìÑ');
      return;
    }

    setLoading(true);
    const data = new FormData();
    Object.keys(formData).forEach(key => data.append(key, formData[key]));
    data.append('resume', file);

    try {
      await resumeAPI.upload(data);
      setMessage('Resume uploaded successfully! üéâ');
      setFormData({ candidateName: '', email: '', phone: '', skills: '', experience: '', education: '' });
      setFile(null);
      document.getElementById('resume-file').value = '';
      onResumeUploaded?.();
    } catch (error) {
      setMessage('Error uploading resume ‚ùå');
    }
    setLoading(false);
  };

  return (
    <Card className="card-hover">
      <Card.Header className="bg-success text-white">
        <h4 className="mb-0">üìÑ Upload Your Resume</h4>
      </Card.Header>
      <Card.Body>
        {message && (
          <Alert variant={message.includes('Error') ? 'danger' : 'success'} className="mb-3">
            {message}
          </Alert>
        )}
        <Form onSubmit={handleSubmit}>
          <Row>
            <Col md={6}>
              <Form.Group className="mb-3">
                <Form.Label className="fw-bold">Full Name</Form.Label>
                <Form.Control 
                  value={formData.candidateName} 
                  onChange={(e) => setFormData({...formData, candidateName: e.target.value})} 
                  placeholder="John Doe"
                  required 
                />
              </Form.Group>
            </Col>
            <Col md={6}>
              <Form.Group className="mb-3">
                <Form.Label className="fw-bold">Email Address</Form.Label>
                <Form.Control 
                  type="email" 
                  value={formData.email} 
                  onChange={(e) => setFormData({...formData, email: e.target.value})} 
                  placeholder="john@example.com"
                  required 
                />
              </Form.Group>
            </Col>
          </Row>

          <Row>
            <Col md={6}>
              <Form.Group className="mb-3">
                <Form.Label className="fw-bold">Phone Number</Form.Label>
                <Form.Control 
                  value={formData.phone} 
                  onChange={(e) => setFormData({...formData, phone: e.target.value})} 
                  placeholder="(555) 123-4567"
                />
              </Form.Group>
            </Col>
            <Col md={6}>
              <Form.Group className="mb-3">
                <Form.Label className="fw-bold">Education</Form.Label>
                <Form.Control 
                  value={formData.education} 
                  onChange={(e) => setFormData({...formData, education: e.target.value})} 
                  placeholder="BS Computer Science"
                />
              </Form.Group>
            </Col>
          </Row>

          <Form.Group className="mb-3">
            <Form.Label className="fw-bold">Key Skills</Form.Label>
            <Form.Control 
              value={formData.skills} 
              onChange={(e) => setFormData({...formData, skills: e.target.value})} 
              placeholder="React, Node.js, Python, SQL (comma-separated)"
            />
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Label className="fw-bold">Experience Summary</Form.Label>
            <Form.Control 
              as="textarea" 
              rows={2} 
              value={formData.experience} 
              onChange={(e) => setFormData({...formData, experience: e.target.value})} 
              placeholder="Brief summary of your work experience..."
            />
          </Form.Group>

          <Form.Group className="mb-4">
            <Form.Label className="fw-bold">Resume File</Form.Label>
            <div className="upload-area">
              <div className="mb-3">
                <i className="fas fa-cloud-upload-alt" style={{fontSize: '3rem', color: '#007bff'}}></i>
                <h5 className="mt-2">Choose your resume file</h5>
                <p className="text-muted">PDF, DOC, DOCX, or TXT files accepted</p>
              </div>
              <Form.Control 
                id="resume-file"
                type="file" 
                accept=".pdf,.txt,.doc,.docx" 
                onChange={(e) => setFile(e.target.files[0])} 
                required 
              />
            </div>
          </Form.Group>

          <Button type="submit" className="btn-gradient w-100" disabled={loading}>
            {loading ? 'üîÑ Uploading...' : 'üöÄ Upload Resume'}
          </Button>
        </Form>
      </Card.Body>
    </Card>
  );
};

export default ResumeUpload;
